import React from "react";
import { Card, Button } from "react-bootstrap";
import cardimg from '';

function Features() {


  return (
    <div>
      <h3></h3>
      <div className="m-5">
        <Card style={{ width: "15rem" }}>
          <Card.Img variant="top" src={cardimg} style={{width:'20px',height:'30px'}} />
          <Card.Body>
            <Card.Title>Nature</Card.Title>
            <Card.Text>
              <li>Alstroemeria</li>
              <li>Calla Lily</li>
              <li>Daisy</li>
              <li>Gardenia</li>
              <li>Carnation</li>
              <li>Gerbera Daisy</li>
            </Card.Text>
            <Button variant="primary" href="/">
              Go somewhere
            </Button>
          </Card.Body>
        </Card>
      </div>
    </div>
  );
}

export default Features;
